import React from "react";

function GalleryPage() {
  return (
    <>
      <div className="pl-20">
        <div className="text-white p-4 text-xl">GalleryPage</div>
        {/* Categories of art: All, Portraits, Graphite, Charcoal, Color Pencil, Digital */}
        <div className="flex flex-row justify-center">
          {["All", "Portraits", "Graphite", "Charcoal", "Color Pencil", "Digital"].map(
            (category) => (
              <div key={category} className="text-white flex items-center m-2 rounded-md">
                <span className=" pr-2">----</span>
                <span className="p-2">{category}</span>
              </div>
            )
          )}
        </div>
        {/* Have a frame for each photo, a white window mat, and the portrait in the center */}
      </div>
    </>
  );
}

export default GalleryPage;
